import React from 'react';
import '../Modal.css';
import closebtn from '../images/Close_Btn.png'

const Modal = ({ isOpen, close }) => {
  return (
      <React.Fragment>
          {
              isOpen ?
                  <React.Fragment>
                      <div className="Modal-overlay" onClick={close} />
                      <div className="Modal">
                          <div className="button-wrap">
                              <button onClick={close} style={{style:"none"}}><img src={closebtn}></img></button>
                          </div>
                          <p className="title">공유할 그룹을 선택해 주세요</p>
                          <div className="content">
                              <p>
                                  Lorem, ipsum dolor sit amet consectetur adipisicing elit. Vel tempora nulla, non molestiae dicta ducimus. Et unde laborum eveniet ex quod doloribus quae, aliquam beatae atque, vero assumenda rem quo?
    	                    </p>
                          </div>

                      </div>
                  </React.Fragment>
            : null
            }
    </React.Fragment>
  )
}
export default Modal;
